VOICEMACRO_20_Hu_1_FEMALE = "저도 가끔 누군가에게 조종되고 있다는 느낌을 받거든요. 보이지 않는 거대한 손 말이에요.";
VOICEMACRO_20_Hu_2 = "어떤 토끼가 약제상에 와서 이렇게 말했다죠. \"당근 주세요. 참, 당근, 외상인거 아시죠?\"";
VOICEMACRO_20_Hu_2_FEMALE = "가끔씩... 제 목소리 크기를 조절하지 못할 때가 있어요!!!";
VOICEMACRO_20_Hu_3 = "타우렌이 초원에서 몸을 숨길 땐 어떻게 하는지 아세요? 소 떼를 찾아서 엎드린다. 간단하죠?";
VOICEMACRO_20_Hu_3_FEMALE = "저는 욕조 안에서 물장난 하는 걸 좋아해요.";
VOICEMACRO_20_Hu_4 = "어떤 노움이 갑자기 이러는 거예요. \"난 노움이야. 나는 노움, 노움이라니까.\" 하도 짜증이나 한 마디 했어요. \"그래, 너 잘난 놈이다.\"";
VOICEMACRO_20_Hu_4_FEMALE = "인간 여자들은 모두 55 사이즈라 아무거나 주워입어도 꼭 맞아요.";
VOICEMACRO_20_Hu_5 = "괜찮은 영화 소재가 있어요. 절대 팔찌를 발견한 두 명의 노움에 관한 얘긴데 팔찌를 불타는 평원으로 가져가서 용광로 안에 집어 던져야 하는 거예요. '팔찌 원정대'를 결성해서 여행을 하던 중에 팔찌에 영혼을 판 골록이라는 멀록과 아홉 팔찌 귀신을 만나게 됩니다. \"팔찌의 군주\"라는 제목으로 3부작을 만들 생각인데 1부는 제목을 \"팔찌 원정대\"라고 하고, 2부는 \"쌍둥이 탑,\" 그리고 대단원의 3부는 \"왕이 돌아오다\"라고 할 겁니다.";
VOICEMACRO_20_Hu_5_FEMALE = "여긴 제대로된 미용실 하나가 없다니까.";
VOICEMACRO_20_Hu_6_FEMALE = "퀘스트 정말 지루하네... 팔찌의 제왕이나 보러갈까?";
VOICEMACRO_20_Ni_0 = "어젯밤에 여자들끼리만 모이는 멋진 파티에 갔었습니다.";
