VOICEMACRO_20_Ni_1 = "다르나서스에 있는 고대 수호정령 아시죠? 사실 그렇게 나이가 많은 건 아니랍니다.";
VOICEMACRO_20_Ni_1_FEMALE = "사실, 전 아침형 엘프에요. 모닝 엘프.";
VOICEMACRO_20_Ni_2 = "에메랄드의 단꿈에 젖어 있는데 화장실이 가고 싶어지더라고요.";
