VOICEMACRO_20_Ni_3 = "그거 절 해칠만큼 날카롭나요? 전 이제 불사의 존재가 아닙니다.";
VOICEMACRO_20_Ni_3_FEMALE = "남자들이 연락을 끊고 날 피할 때마다 에메랄드의 꿈 핑계를 대더라고요.";
VOICEMACRO_20_Ni_4 = "당신은 어떨지 잘 모르겠지만 전 위습이 하는 말은 도통 못알아듣겠더라니까요... 그냥 고개만 끄덕였죠.";
VOICEMACRO_20_Ni_4_FEMALE = "전 춤의 여왕이에요. 제가 춤을 추면 모두들 반해서 쳐다보죠.";
VOICEMACRO_20_Ni_5 = "영원한 생명을 원하십니까?";
VOICEMACRO_20_Ni_6 = "뭐라고요? 잘못 들었어요.";
